import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
    width: 100%;
    height: 100vh;
    display: flex;
    background-color: #B6EFFF;
    margin-top: 20px;
`;

const Wrapper = styled.div`
  height: 100%;
`;

const ImgContainer = styled.div`
  flex: 1;
`;

const Image = styled.img`

`;

const InfoContainer = styled.img`
  flex: 1;
`;

const Title = styled.h1``;

const Desc = styled.p``;

const Button = styled.button``;

    


const SingleSlide = () => {
  return (
    <Container>
      <Wrapper>
        <ImgContainer>
            <Image />
        </ImgContainer>

        <InfoContainer>
            <Title>CAT FANCIERS'</Title>
            <Desc></Desc>
            <Button></Button>
        </InfoContainer>
      </Wrapper>
    </Container>
  );
}

export default SingleSlide;
